import Header from "../components/Header";
import Button from "../components/Button";
import { useNavigate } from "react-router-dom";
import { useState } from "react";
import SetProfile from "../components/SetProfile";
import axios from "axios";
import { useEffect } from "react";

const PROFILE_URL = `https://mapdagu.site/api/members/me/info`

const EditProfile = () => {
    const navigate = useNavigate();
    const initData = 1;

    const goBack = () => {
        navigate(-1);
    }
    const onSubmit = (data) => {
        // const { userName, imageNum, intro } = data;
        console.log("done");        
    }
    return (
        <div>
            {/* <Header title="edit profile"
                    leftChild={<Button text="취소" onClick={goBack}/>}
                    rightChild={<Button text="완료" onClick={onSubmit}/>}
            />             */}
            <SetProfile initData={initData} onSubmit={onSubmit}/>
        </div>
    );
}

export default EditProfile;
